using namespace std;

bool has_close_elements(vector<float> numbers, float threshold) {
    if (numbers.size() < 2) {
        return false;
    }

    sort(numbers.begin(), numbers.end());

    for (size_t i = 0; i < numbers.size() - 1; ++i) {
        float diff = fabs(numbers[i+1] - numbers[i]);
        if (diff < threshold) {
            return true;
        }
    }

    return false;
}

