To solve this problem, we need to identify and extract all valid parentheses groups from a given string. A valid parentheses group is defined as a sequence of parentheses that are properly nested and closed. 

### Approach
The approach involves iterating through each character in the string while maintaining a balance counter. The balance counter helps us track whether we are inside a valid parentheses group. Here's a step-by-step breakdown:

1. **Initialize Variables**: We use `temp_str` to build the current group of parentheses, `result` to store all valid groups found, and `balance` to keep track of the nesting level.

2. **Iterate Through Each Character**:
   - For each opening parenthesis '(', we increment the balance counter.
   - For each closing parenthesis ')', we decrement the balance counter.
   - If the balance counter drops below zero, it indicates an invalid group starting with a closing parenthesis, so we reset `temp_str` and continue.

3. **Check for Valid Group**:
   - After processing each character, if the balance counter reaches zero, it means we have found a valid parentheses group. We add this group to our result list and reset `temp_str` to start building the next potential group.

4. **Edge Cases**: The solution handles edge cases such as an empty string or strings with no valid groups by returning an empty list.

