using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;
    istringstream iss(paren_string);
    string group;

    while (iss >> group) { // Split the input into groups separated by whitespace
        int current_depth = 0;
        int max_depth = 0;

        for (char c : group) {
            if (c == '(') {
                current_depth++;
                if (current_depth > max_depth) {
                    max_depth = current_depth;
                }
            } else { // When encountering ')'
                current_depth--;
            }
        }

        result.push_back(max_depth);
    }

    return result;
}

