vector<int> factorize(int n) {
    vector<int> factors;
    if (n <= 1) return factors; // No prime factors for numbers less than or equal to 1

    int i = 2;
    while (i * i <= n) {
        while (n % i == 0) {
            factors.push_back(i);
            n /= i;
        }
        ++i;
    }

    if (n > 1) {
        factors.push_back(n); // The remaining n is a prime factor
    }

    return factors;
}

