using namespace std;

string sort_numbers(const string& numbers) {
    // Mapping from numeral strings to their integer values
    unordered_map<string, int> number_map = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    // Split the input string into individual words
    vector<string> words;
    stringstream ss(numbers);
    string word;
    while (ss >> word) {
        words.push_back(word);
    }

    // Sort the words based on their numeric values using the map
    sort(words.begin(), words.end(), [&number_map](const string& a, const string& b) {
        return number_map[a] < number_map[b];
    });

    // Join the sorted words into a single string separated by spaces
    stringstream oss;
    for (size_t i = 0; i < words.size(); ++i) {
        if (i != 0) {
            oss << " ";
        }
        oss << words[i];
    }

    return oss.str();
}

