int modp(int n, int p) {
    if (p == 1) return 0;
    long result = 1;
    long base = 2 % p;
    while (n > 0) {
        if (n % 2 == 1) {
            result = (result * base) % p;
        }
        base = (base * base) % p;
        n /= 2;
    }
    return (int)result;
}

