int largest_prime_factor(int n) {
    int max_prime = -1;

    // Divide out 2s
    while (n % 2 == 0) {
        max_prime = 2;
        n /= 2;
    }

    // Check odd numbers up to sqrt(n)
    for (int i = 3; i * i <= n; i += 2) {
        while (n % i == 0) {
            max_prime = i;
            n /= i;
        }
    }

    // If remaining n is a prime
    if (n > 2)
        max_prime = n;

    return max_prime;
}


