string circular_shift(int x, int shift) {
    string s = to_string(x);
    int len = s.length();

    if (len == 0) {
        return "";
    }

    if (shift > len) {
        reverse(s.begin(), s.end());
        return s;
    } else {
        int k = shift;
        string shifted = s.substr(len - k, k) + s.substr(0, len - k);
        return shifted;
    }
}

