        freq[num]++;
    }

    int max_candidate = -1;

    for (auto& pair : freq) {
        int num = pair.first;
        int count = pair.second;

        if (count >= num && num > 0) {
            if (num > max_candidate) {
                max_candidate = num;
            }
        }
    }

