float triangle_area(float a, float b, float c) {
    if (a <= 0 || b <= 0 || c <= 0) {
        return -1;
    }

    vector<float> sides = {a, b, c};
    sort(sides.begin(), sides.end());

    float x = sides[0];
    float y = sides[1];
    float z = sides[2];

    if (x + y <= z) {
        return -1;
    }

    float s = (a + b + c) / 2.0f;
    float area_sq = s * (s - a) * (s - b) * (s - c);

    if (area_sq <= 0) {
        return -1;
    }

    float area = sqrt(area_sq);
    area = round(area * 100.0f) / 100.0f;

    return area;
}

