// Forward declaration of is_multiply_prime
bool is_multiply_prime(int n);

bool isPrime(int n)  {
    if  (n <= 1) return false;
    for  (int i = 2; i * i <= n; ++i)  {
        if  (n % i == 0) return false;
     }
    return true;
}

int countPrimeFactors(int n)  {
    int count = 0;
    if  (isPrime(n))  {
        count++;
        return count;
     }
    for  (int i = 2; i * i <= n; ++i)  {
        if  (n % i == 0 && isPrime(i))  {
            count++;
            while  (n % i == 0)  {
                n /= i;
             }
         }
     }
    if  (n > 1 && isPrime(n))  {
        count++;
     }
    return count;
}

bool is_multiply_prime(int n)  {
    int factors = countPrimeFactors(n);
    return factors == 3;
}

