bool isPalindrome(int number) {
    string numStr = to_string(number);
    int left = 0;
    int right = numStr.length() - 1;

    while (left < right) {
        if (numStr[left] != numStr[right]) {
            return false;
        }
        left++;
        right--;
    }
    return true;
}

bool iscube(int n) {
    int cube_plus_100 = n * n * n + 100;
    return isPalindrome(cube_plus_100);
}


