using namespace std;

string solve(int N) {
    int sum = 0;
    int n = N; // Make a copy of N to avoid modifying the original value
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }

    if (sum == 0) {
        return "0";
    }

    string binary;
    while (sum > 0) {
        int rem = sum % 2;
        binary += (rem ? '1' : '0');
        sum /= 2;
    }
    reverse(binary.begin(), binary.end());

    return binary;
}

