string encrypt(string s) {
    for (int i = 0; i < s.size(); ++i) {
        char c = s[i];
        if (c >= 'a' && c <= 'z') {
            int shifted = (c - 'a' + 4) % 26;
            s[i] = 'a' + shifted;
        } else if (c >= 'A' && c <= 'Z') {
            int shifted = (c - 'A' + 4) % 26;
            s[i] = 'A' + shifted;
        }
    }
    return s;
}

