vector<string> splitIntoSentences(const string &s) {
    vector<string> sentences;
    size_t start = 0;
    while (start < s.size()) {
        size_t dotPos = s.find('.', start);
        size_t qmarkPos = s.find('?', start);
        size_t exclamPos = s.find('!', start);

        size_t minPos = s.size();

        if (dotPos != string::npos) {
            minPos = dotPos;
        }
        if (qmarkPos != string::npos && qmarkPos < minPos) {
            minPos = qmarkPos;
        }
        if (exclamPos != string::npos && exclamPos < minPos) {
            minPos = exclamPos;
        }

        sentences.push_back(s.substr(start, minPos - start));
        start = minPos + 1;

        if (minPos == s.size()) {
            break;
        }
    }
    return sentences;
}

string trim(const string &s) {
    size_t first = s.find_first_not_of(" \t\n\r");
    if (first == string::npos) {
        return "";
    }
    size_t last = s.find_last_not_of(" \t\n\r");
    return s.substr(first, (last - first + 1));
}

int is_bored(string S) {
    vector<string> sentences = splitIntoSentences(S);
    int count = 0;

    for (string sentence : sentences) {
        string trimmedSentence = trim(sentence);
        if (!trimmedSentence.empty() && trimmedSentence[0] == 'I') {
            count++;
        }
    }

    return count;
}


