string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }

    int count = m - n + 1;
    long long sum = (long long)(n + m) * count / 2;
    long long average = sum / count;

    if (average == 0) {
        return "0";
    }

    bool isNegative = false;
    if (average < 0) {
        isNegative = true;
        average = -average; // take absolute value for processing
    }

    string binary;
    while (average > 0) {
        int remainder = average % 2;
        binary.push_back(remainder + '0');
        average /= 2;
    }
    reverse(binary.begin(), binary.end());

    if (isNegative) {
        binary.insert(0, 1, '-');
    }

    return binary;
}

