int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (num == 0) continue; // Skip as sum is zero

        bool is_negative = (num < 0);
        int abs_num = abs(num);

        vector<int> digits;
        int temp = abs_num;
        while (temp > 0) {
            int digit = temp % 10;
            digits.push_back(digit);
            temp /= 10;
        }
        reverse(digits.begin(), digits.end());

        int sum_digits = 0;
        for (int i = 0; i < digits.size(); ++i) {
            if (i == 0 && is_negative) {
                sum_digits += (-digits[i]);
            } else {
                sum_digits += digits[i];
            }
        }

        if (sum_digits > 0) {
            count++;
        }
    }
    return count;
}

