    for (const auto& row : grid) {
        int sum = 0;
        for (int num : row) {
            sum += num;
        }
        if (sum == 0) continue;
        int lowers_needed = (sum + capacity - 1) / capacity;
        total_lowers += lowers_needed;
    }
    return total_lowers;
}

