// To solve this problem, we need to sort an array of integers based on the number of 1s in their binary representation.
// If two numbers have the same number of 1s, they should be sorted in ascending order.

vector<int> sort_array(vector<int> arr){
     // Custom comparator function
    auto countOnes = [](int n) {
        int ones = 0;
        n = abs(n);  // Take absolute value to handle negative numbers
        while (n > 0) {
            ones += n & 1;
            n >>= 1;
         }
        return ones;
     };

    sort(arr.begin(), arr.end(), [countOnes](int a, int b) {
        int countA = countOnes(a);
        int countB = countOnes(b);
