string get_closest_vowel(string word) {
    int n = word.size();

    // Iterate from the second last character to the second character
    for (int i = n - 2; i >= 1; --i) {
        if (VOWELS.find(word[i]) != string::npos) {
            // Check if previous and next characters are consonants
            bool prevIsConsonant = VOWELS.find(word[i-1]) == string::npos;
            bool nextIsConsonant = VOWELS.find(word[i+1]) == string::npos;

            if (prevIsConsonant && nextIsConsonant) {
                return string(1, word[i]);
            }
        }
    }

    // Return empty string if no vowel found
    return "";
}

