bool valid_date(string date) {
    if (date.empty()) return false;

    // Check length is 10
    if (date.length() != 10) return false;

    // Check hyphens are at correct positions
    if (date[2] != '-' || date[5] != '-') return false;

    // Check each part for digits only
    for (int i = 0; i < 2; ++i) {
        if (!isdigit(date[i])) return false;
    }
    for (int i = 3; i < 5; ++i) {
        if (!isdigit(date[i])) return false;
    }
    for (int i = 6; i < 10; ++i) {
        if (!isdigit(date[i])) return false;
    }

    // Extract month, day, year
    int month = stoi(date.substr(0, 2));
    int day = stoi(date.substr(3, 2));
    int year = stoi(date.substr(6, 4));  // Year is not used beyond this

    // Check valid month
    if (month < 1 || month > 12) return false;

    // Determine maximum days for the given month
    int max_day;
    switch(month) {
        case 1: case 3: case 5: case 7: case 8: case 10: case 12:
            max_day = 31;
            break;
        case 4: case 6: case 9: case 11:
            max_day = 30;
            break;
        case 2:
            max_day = 29;  // Assuming no leap year check
            break;
        default:
            return false;  // Shouldn't reach here
    }

    // Check valid day
    if (day < 1 || day > max_day) return false;

    return true;
}


