vector<string> split_words(string txt) {
    vector<string> result;

    // Check if there are spaces in the string
    size_t space_pos = txt.find(' ');
    if (space_pos != string::npos) {
        // Split on spaces
        string current_word;
        for (char c : txt) {
            if (c == ' ') {
                result.push_back(current_word);
                current_word.clear();
            } else {
                current_word += c;
            }
        }
        result.push_back(current_word);  // Add the last word
    } else {
        // Check if there are commas in the string
        size_t comma_pos = txt.find(',');
        if (comma_pos != string::npos) {
            // Split on commas
            string current_part;
            for (char c : txt) {
                if (c == ',') {
                    result.push_back(current_part);
                    current_part.clear();
                } else {
                    current_part += c;
                }
            }
            result.push_back(current_part);  // Add the last part
        } else {
            // Count lowercase letters with odd order in the alphabet
            int count = 0;
            for (char c : txt) {
                if (islower(c)) {
                    int ord = c - 'a';
                    if (ord % 2 == 1) {  // Check if odd
                        count++;
                    }
                }
            }
            result.push_back(to_string(count));
        }
    }

    return result;
}

