bool is_sorted(vector<int> lst) {
    if (lst.size() <= 1) {
        return true;
    }

    // Check if the list is sorted in ascending order
    for (int i = 0; i < lst.size() - 1; ++i) {
        if (lst[i] > lst[i + 1]) {
            return false;
        }
    }

    // Check for consecutive duplicates exceeding two occurrences
    int count = 1;
    for (int i = 1; i < lst.size(); ++i) {
        if (lst[i] == lst[i - 1]) {
            count++;
            if (count > 2) {
                return false;
            }
        } else {
            count = 1;
        }
    }

    return true;
}

