        if (num == 0) {
            sign = 0;
        } else if (num > 0) {
            sign = 1;
        } else {
            sign = -1;
        }

        product_sign *= sign;

        // Early exit if product becomes zero
        if (product_sign == 0) {
            break;
        }
    }

    return sum_mag * product_sign;
}

