int digits(int n) {
    int product = 1;
    bool hasOdd = false;
    while (n > 0) {
        int d = n % 10;
        if (d % 2 != 0) {
            product *= d;
            hasOdd = true;
        }
        n /= 10;
    }
    return hasOdd ? product : 0;
}

