vector<int> tri(int n) {
    vector<int> result(n + 1);
    if (n >= 0) result[0] = 1;
    if (n >= 1) result[1] = 3;

    for (int i = 2; i <= n; ++i) {
        if (i % 2 == 0) {
            result[i] = 1 + (i / 2);
        } else {
            int next_even = i + 1;
            if (next_even > n) {
                // Handle cases where next_even exceeds the desired size
                result[i] = result[i-1] + result[i-2];
            } else {
                result[i] = result[i-1] + result[i-2] + result[next_even];
            }
        }
    }

    return result;
}

