bool check_if_last_char_is_a_letter(string txt) {
    // Trim trailing spaces
    size_t end = txt.find_last_not_of(' ');
    if (end == string::npos) return false;  // Empty after trimming

    char lastChar = txt[end];

    // Check if the last character is an alphabetical letter
    if (!isalpha(lastChar)) return false;

    // Ensure it's not part of a word (i.e., either at position 0 or preceded by space)
    if (end == 0) return true;  // Only one character

    char prevChar = txt[end - 1];
    return prevChar == ' ';
}

