using namespace std;

float parse_value(const boost::any& x) {
    if (x.type() == typeid(int)) {
        return boost::any_cast<int>(x);
    } else if (x.type() == typeid(float)) {
        return boost::any_cast<float>(x);
    } else if (x.type() == typeid(double)) {
        return static_cast<float>(boost::any_cast<double>(x));
    } else if (x.type() == typeid(string)) {
        string s = boost::any_cast<string>(x);
        replace(s.begin(), s.end(), ',', '.');
        try {
            return stof(s);
        } catch (const invalid_argument& e) {
            throw runtime_error("Invalid number format: " + s);
        }
    } else {
        throw runtime_error("Unsupported type");
    }
}

boost::any compare_one(boost::any a, boost::any b) {
    float a_val = parse_value(a);
    float b_val = parse_value(b);

    if (a_val == b_val) {
        return string("None");
    } else if (a_val > b_val) {
        return a;
    } else {
        return b;
    }
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (boost::any_cast<int>(compare_one(1, 2)) == 2);
    assert (boost::any_cast<double>(compare_one(1, 2.5))== 2.5);
    assert (boost::any_cast<int>(compare_one(2, 3)) == 3);
    assert (boost::any_cast<int>(compare_one(5, 6)) == 6);
    assert (boost::any_cast<string>(compare_one(1, string("2,3")))== "2,3");
    assert (boost::any_cast<string>(compare_one(string("5,1"), string("6"))) == "6");
    assert (boost::any_cast<string>(compare_one(string("1"), string("2"))) == "2");
    assert (boost::any_cast<string>(compare_one(string("1"), 1)) == "None");
}

