bool simplify(string x, string n) {
    // Parse first fraction x into numerator and denominator
    size_t pos = x.find('/');
    long long x_num = stoll(x.substr(0, pos));
    long long x_den = stoll(x.substr(pos + 1));

    // Parse second fraction n into numerator and denominator
    pos = n.find('/');
    long long n_num = stoll(n.substr(0, pos));
    long long n_den = stoll(n.substr(pos + 1));

    // Compute the product's numerator and denominator
    long long product_num = x_num * n_num;
    long long product_den = x_den * n_den;

    // Check if the product is an integer by verifying divisibility
    return (product_num % product_den) == 0;
}

