int get_max_triples(int n) {
    vector<int> a(n);
    for (int i = 0; i < n; ++i) {
        a[i] = (i + 1) * (i + 1) - (i + 1) + 1;
    }

    int count0 = 0, count1 = 0, count2 = 0;
    for (int num : a) {
        switch(num % 3) {
            case 0: count0++; break;
            case 1: count1++; break;
            case 2: count2++; break;
        }
    }

    int total = 0;
    // All three same
    if (count0 >= 3) total += count0 * (count0 - 1) * (count0 - 2) / 6;
    if (count1 >= 3) total += count1 * (count1 - 1) * (count1 - 2) / 6;
    if (count2 >= 3) total += count2 * (count2 - 1) * (count2 - 2) / 6;

    // One from each
    total += count0 * count1 * count2;

    return total;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (get_max_triples(5) == 1);
    assert (get_max_triples(6) == 4);
    assert (get_max_triples(10) == 36);
    assert (get_max_triples(100) == 53361);
}

