struct Element {
    int sum;
    int idx;
    int val;
};

int get_sum(int n) {
    if (n == 0) return 0;
    int sign = n < 0 ? -1 : 1;
    string s_num = to_string(abs(n));
    int sum = 0;
    sum += (s_num[0] - '0') * sign;
    for (size_t i = 1; i < s_num.size(); ++i) {
        sum += (s_num[i] - '0');
    }
    return sum;
}

vector<int> order_by_points(vector<int> nums) {  // Renamed function to match the declaration
    vector<Element> elements;
    for (int i = 0; i < nums.size(); ++i) {
        int n = nums[i];
        int s = get_sum(n);
        elements.push_back({s, i, n});
    }
    sort(elements.begin(), elements.end(), [](const Element& a, const Element& b) {
        if (a.sum != b.sum) {
            return a.sum < b.sum;
        } else {
            return a.idx < b.idx;
        }
    });
    vector<int> result;
    for (auto& e : elements) {
        result.push_back(e.val);
    }
    return result;
}

