string Strongest_Extension(string class_name, vector<string> extensions) {
    int max_strength = INT_MIN;
    string strongest_ext;

    for (const string& ext : extensions) {
        int cap = 0, sm = 0;
        for (char c : ext) {
            if (c >= 'A' && c <= 'Z') {
                cap++;
            } else if (c >= 'a' && c <= 'z') {
                sm++;
            }
        }
        int strength = cap - sm;

        if (strength > max_strength) {
            max_strength = strength;
            strongest_ext = ext;
        }
    }

