using namespace std;

bool right_angled_triangle(float a, float b, float c) {
    // Check if any side is non-positive
    if (a <= 0 || b <= 0 || c <= 0) {
        return false;
    }

    vector<float> sides = {a, b, c};
    sort(sides.begin(), sides.end());
    float x = sides[0];
    float y = sides[1];
    float z = sides[2];

    // Check triangle inequality
    if (x + y <= z) {
        return false;
    }

    // Compute squares
    float sum_squares = x * x + y * y;
    float z_square = z * z;

    // Compare with epsilon to handle floating point precision issues
    const float EPSILON = 1e-6f; // Using float for consistency

    return abs(sum_squares - z_square) < EPSILON;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (right_angle_triangle(3, 4, 5) == true);
    assert (right_angle_triangle(1, 2, 3) == false);
    assert (right_angle_triangle(10, 6, 8) == true);
    assert (right_angle_triangle(2, 2, 2) == false);
    assert (right_angle_triangle(7, 24, 25) == true);
    assert (right_angle_triangle(10, 5, 7) == false);
    assert (right_angle_triangle(5, 12, 13) == true);
    assert (right_angle_triangle(15, 8, 17) == true);
    assert (right_angle_triangle(48, 55, 73) == true);
    assert (right_angle_triangle(1, 1, 1) == false);
    assert (right_angle_triangle(2, 2, 10) == false);
}

