using namespace std;

string find_max(vector<string> words) {
    int max_unique = -1;
    string result;

    for (string word : words) {
        set<char> s(word.begin(), word.end());
        int unique_count = s.size();

        if (max_unique == -1 || unique_count > max_unique) {
            max_unique = unique_count;
            result = word;
        } else if (unique_count == max_unique) {
            if (word < result) {
                result = word;
            }
        }
    }

    return result;
}

