using namespace std;

string solve(string s) {
    bool has_letters = false;
    for (char c : s) {
        if (isalpha(c)) {
            has_letters = true;
            break;
        }
    }

    if (!has_letters) {
        reverse(s.begin(), s.end());
    } else {
        for (int i = 0; i < s.size(); ++i) {
            char &c = s[i];
            if (islower(c)) {
                c = toupper(c);
            } else if (isupper(c)) {
                c = tolower(c);
            }
        }
    }

    return s;
}

