using namespace std;

int precedence(const string& op) {
    if (op == "+" || op == "-") return 1;
    if (op == "*" || op == "/") return 2;
    if (op == "**") return 3;
    return 0;
}

vector<string> infix_to_postfix(const vector<string>& operators, const vector<int>& operands) {
    vector<string> postfix;
    stack<string> op_stack;

    for (size_t i = 0; i < operands.size(); ++i) {
        postfix.push_back(to_string(operands[i]));
        if (i < operators.size()) {
            string current_op = operators[i];
            while (!op_stack.empty() && precedence(op_stack.top()) >= precedence(current_op)) {
                postfix.push_back(op_stack.top());
                op_stack.pop();
            }
            op_stack.push(current_op);
        }
    }

    while (!op_stack.empty()) {
        postfix.push_back(op_stack.top());
        op_stack.pop();
    }

    return postfix;
}

int evaluate_postfix(const vector<string>& postfix) {
    stack<int> operand_stack;

    for (const string& token : postfix) {
        if (token == "+" || token == "-" || token == "*" || token == "/" || token == "**") {
            int b = operand_stack.top();
            operand_stack.pop();
            int a = operand_stack.top();
            operand_stack.pop();

            if (token == "+") operand_stack.push(a + b);
            else if (token == "-") operand_stack.push(a - b);
            else if (token == "*") operand_stack.push(a * b);
            else if (token == "/") operand_stack.push(a / b); // Assuming integer division
            else if (token == "**") operand_stack.push(pow(a, b));
        } else {
            operand_stack.push(stoi(token));
        }
    }

    return operand_stack.top();
}

int do_algebra(const vector<string>& operators, const vector<int>& operands) {
    vector<string> postfix = infix_to_postfix(operators, operands);
    return evaluate_postfix(postfix);
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (do_algebra({"**", "*", "+"}, {2, 3, 4, 5}) == 37);
    assert (do_algebra({"+", "*", "-"}, {2, 3, 4, 5}) == 9);
    assert (do_algebra({"//", "*"}, {7, 3, 4}) == 8);
}
